import React, { useState } from "react";
import { Link } from "react-router-dom";
import logo from './logo.png';
import { APIProvider, Map } from '@vis.gl/react-google-maps';

const Reservations = () => {
    const [hideBlocks, setHideBlocks] = useState(false);

    const toggleBlocks = () => {
        setHideBlocks(!hideBlocks);
    };

    return (
        <APIProvider apiKey={"AIzaSyDnk8killPj2EO1k_H9V1ocew2crxglWbM"}>
            <>
                <nav>
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home" title="Home"><b>Home</b></Link>
                    <Link to="/Dashboard" title="Dashboard"><b>Dashboard</b></Link>
                    <Link to="/Profile" title="Profile"><b>Profile</b></Link>
                    <Link to="/Reservations" title="Reservations"><b>Reservations</b></Link>
                    <Link to="#" title="Sign Out" style={{ marginRight: '-10px' }}><b>Sign Out</b></Link>
                </nav>

                <div id="column_one" style={{ display: hideBlocks ? 'none' : 'inline' }}>
                    {/* Blocks to be shown or hidden */}
                </div>

                <div id="column_two" style={{ width: hideBlocks ? '100%' : '80%' }}>
                    {/* Content of column two */}
                </div>

                <button id="HideBtn" onClick={toggleBlocks}>
                    {hideBlocks ? "Show Blocks" : "Hide Blocks"}
                </button>

                <footer className="footer">
                    <small className="f6 db tc">Â©<b className="ttu">Created by Group CC</b>., All Rights Reserved</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default Reservations;
